import React from "react";
import ImageUpload from "./FormComponents/ImageUpload";

type LevelOneProps = React.DetailedHTMLProps<
  React.SelectHTMLAttributes<HTMLSelectElement>,
  HTMLSelectElement
> & { options: typeof Option[] } & HTMLSelectElement;

const LevelOneForm = React.forwardRef<LevelOneProps, { label: string }>(
  ({ label }, ref) => (
    <div>
      <h2>Level One</h2>
      <ImageUpload name={label} ref={ref} />
    </div>
  )
);

export default LevelOneForm;
